                                </div>
                                <div style={{ padding: '12px', background: colors.lightGray, borderRadius: '8px' }}>
                                    <div style={{ fontSize: '11px', color: colors.gray, marginBottom: '4px' }}>Lead CVR</div>
                                    <div style={{ fontSize: '20px', fontWeight: 'bold', color: colors.green }}>
                                        {themeMetrics.leadCVR.toFixed(1)}%
                                    </div>
                                    <div style={{ fontSize: '11px', color: colors.gray }}>{themeMetrics.leads} leads</div>
                                </div>
                                <div style={{ padding: '12px', background: colors.lightGray, borderRadius: '8px' }}>
                                    <div style={{ fontSize: '11px', color: colors.gray, marginBottom: '4px' }}>Reg CVR</div>
                                    <div style={{ fontSize: '20px', fontWeight: 'bold', color: colors.green }}>
                                        {themeMetrics.regCVR.toFixed(1)}%
                                    </div>
                                    <div style={{ fontSize: '11px', color: colors.gray }}>{themeMetrics.regs} regs</div>
                                </div>
                                <div style={{ padding: '12px', background: colors.lightGray, borderRadius: '8px' }}>
                                    <div style={{ fontSize: '11px', color: colors.gray, marginBottom: '4px' }}>Enrol CVR</div>
                                    <div style={{ fontSize: '20px', fontWeight: 'bold', color: colors.green }}>
                                        {themeMetrics.enrolCVR.toFixed(1)}%
                                    </div>
                                    <div style={{ fontSize: '11px', color: colors.gray }}>{themeMetrics.enrol} enrol</div>
                                </div>
                            </div>
                        </div>
                    )}

                    {modifierMetrics && modifierMetrics.count > 0 && (
                        <div style={{
                            background: 'white',
                            padding: '20px',
                            borderRadius: '12px',
                            marginBottom: '20px',
                            boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
                            border: `3px solid ${colors.yellow}`
                        }}>
                            <h2 style={{ margin: '0 0 5px 0', color: colors.primary, fontSize: '1.3em' }}>
                                 Modifier: "{modifierFilter}" Performance
                            </h2>
                            <p style={{ margin: '0 0 15px 0', fontSize: '0.9em', color: colors.gray }}>
                                Mutually exclusive - keywords only counted once
                            </p>
                            <div style={{ 
                                display: 'grid', 
                                gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))',
                                gap: '15px' 
                            }}>
                                <div style={{ padding: '12px', background: colors.lightGray, borderRadius: '8px' }}>
                                    <div style={{ fontSize: '11px', color: colors.gray, marginBottom: '4px' }}>Total Cost</div>
                                    <div style={{ fontSize: '20px', fontWeight: 'bold', color: colors.primary }}>
                                        ${modifierMetrics.total_cost.toLocaleString(undefined, {minimumFractionDigits: 2, maximumFractionDigits: 2})}
                                    </div>
                                </div>
                                <div style={{ padding: '12px', background: colors.green + '15', borderRadius: '8px', border: `2px solid ${colors.green}` }}>
                                    <div style={{ fontSize: '11px', color: colors.gray, marginBottom: '4px' }}>Lead CVR</div>
                                    <div style={{ fontSize: '20px', fontWeight: 'bold', color: colors.green }}>
                                        {modifierMetrics.lead_cvr.toFixed(1)}%
                                    </div>
                                    <div style={{ fontSize: '11px', color: colors.gray }}>{modifierMetrics.total_leads} leads</div>
                                </div>
                                <div style={{ padding: '12px', background: colors.green + '15', borderRadius: '8px', border: `2px solid ${colors.green}` }}>
                                    <div style={{ fontSize: '11px', color: colors.gray, marginBottom: '4px' }}>Reg CVR</div>
                                    <div style={{ fontSize: '20px', fontWeight: 'bold', color: colors.green }}>
                                        {modifierMetrics.reg_cvr.toFixed(1)}%
                                    </div>
                                    <div style={{ fontSize: '11px', color: colors.gray }}>{modifierMetrics.total_regs} regs</div>
                                </div>
                                <div style={{ padding: '12px', background: colors.green + '15', borderRadius: '8px', border: `2px solid ${colors.green}` }}>
                                    <div style={{ fontSize: '11px', color: colors.gray, marginBottom: '4px' }}>Enrol CVR</div>
                                    <div style={{ fontSize: '20px', fontWeight: 'bold', color: colors.green }}>
                                        {modifierMetrics.enrol_cvr.toFixed(2)}%
                                    </div>
                                    <div style={{ fontSize: '11px', color: colors.gray }}>{modifierMetrics.total_enrol} enrol</div>
                                </div>
                            </div>
                        </div>
                    )}

                    <div style={{
                        background: 'white',
                        padding: '20px',
                        borderRadius: '12px',
                        marginBottom: '20px',
                        boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
                        display: 'grid',
                        gridTemplateColumns: '2fr 1fr 1fr 1fr',
                        gap: '15px',
                        alignItems: 'center'
                    }}>
                        <input
                            type="text"
                            placeholder=" Search keywords..."
                            value={searchTerm}
                            onChange={(e) => setSearchTerm(e.target.value)}
                            style={{
                                padding: '12px 15px',
                                fontSize: '15px',
                                border: `2px solid ${colors.lightGray}`,
                                borderRadius: '8px',
                                outline: 'none'
                            }}
                        />
                        <select
                            value={themeFilter}
                            onChange={(e) => setThemeFilter(e.target.value)}
                            style={{
                                padding: '12px 15px',
                                fontSize: '15px',
                                border: `2px solid ${colors.primary}`,
                                borderRadius: '8px',
                                background: 'white',
                                color: colors.primary,
                                fontWeight: '600',
                                cursor: 'pointer'
                            }}
                        >
                            {themes.map(theme => (
                                <option key={theme} value={theme}>{theme === 'All' ? 'All Themes' : theme}</option>
                            ))}
                        </select>
                        <select
                            value={statusFilter}
                            onChange={(e) => setStatusFilter(e.target.value)}
                            style={{
                                padding: '12px 15px',
                                fontSize: '15px',
                                border: `2px solid ${colors.green}`,
                                borderRadius: '8px',
                                background: 'white',
                                color: colors.green,
                                fontWeight: '600',
                                cursor: 'pointer'
                            }}
                        >
                            {statuses.map(status => (
                                <option key={status} value={status}>{status === 'All' ? 'All Status' : status}</option>
                            ))}
                        </select>
                        <select
                            value={modifierFilter}
                            onChange={(e) => setModifierFilter(e.target.value)}
                            style={{
                                padding: '12px 15px',
                                fontSize: '15px',
                                border: `2px solid ${colors.yellow}`,
                                borderRadius: '8px',
                                background: 'white',
                                color: colors.primary,
                                fontWeight: '600',
                                cursor: 'pointer'
                            }}
                        >
                            {modifiers.map(modifier => (
                                <option key={modifier} value={modifier}>{modifier === 'All' ? 'All Modifiers' : modifier}</option>
                            ))}
                        </select>
                    </div>

                    <div style={{
                        background: 'white',
                        borderRadius: '12px',
                        boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
                        overflow: 'hidden'
                    }}>
                        <div style={{ overflowX: 'auto' }}>
                            <table style={{ width: '100%', borderCollapse: 'collapse', fontSize: '14px' }}>
                                <thead>
                                    <tr style={{ background: colors.lightGray }}>
                                        <th style={headerStyle} onClick={() => handleSort('searchTerm')}>Search Term {getSortIcon('searchTerm')}</th>
                                        <th style={headerStyle} onClick={() => handleSort('theme')}>Theme {getSortIcon('theme')}</th>
                                        <th style={headerStyle} onClick={() => handleSort('status')}>Status {getSortIcon('status')}</th>
                                        <th style={headerStyle} onClick={() => handleSort('monthlySearches')}>Volume {getSortIcon('monthlySearches')}</th>
                                        <th style={headerStyle} onClick={() => handleSort('clicks')}>Clicks {getSortIcon('clicks')}</th>
                                        <th style={headerStyle} onClick={() => handleSort('cost')}>Cost {getSortIcon('cost')}</th>
                                        <th style={headerStyle} onClick={() => handleSort('cpc')}>CPC {getSortIcon('cpc')}</th>
                                        <th style={headerStyle} onClick={() => handleSort('leads')}>Leads {getSortIcon('leads')}</th>
                                        <th style={headerStyle} onClick={() => handleSort('regs')}>Regs {getSortIcon('regs')}</th>
                                        <th style={headerStyle} onClick={() => handleSort('enrol')}>Enrol {getSortIcon('enrol')}</th>
                                        <th style={headerStyle}>CVR %</th>
                                        <th style={headerStyle}>CPA</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {filteredData.slice(0, 10).map((row, idx) => {
                                        const metrics = calculateMetrics(row);
                                        return (
                                            <tr
                                                key={idx}
                                                style={{
                                                    borderBottom: '1px solid #eee',
                                                    cursor: 'pointer',
                                                    background: selectedRow === idx ? colors.yellow + '20' : 'white'
                                                }}
                                                onMouseEnter={(e) => e.currentTarget.style.background = colors.lightGray}
                                                onMouseLeave={(e) => e.currentTarget.style.background = selectedRow === idx ? colors.yellow + '20' : 'white'}
                                                onClick={() => setSelectedRow(selectedRow === idx ? null : idx)}
                                            >
                                                <td style={cellStyle}>{row.keyword}</td>
                                                <td style={{...cellStyle, fontWeight: '600', color: colors.primary}}>{row.theme}</td>
                                                <td style={cellStyle}><StatusBadge status={row.status} /></td>
                                                <td style={cellStyle}>{row.monthlySearches.toLocaleString()}</td>
                                                <td style={cellStyle}>{row.clicks}</td>
                                                <td style={cellStyle}>${row.cost.toFixed(2)}</td>
                                                <td style={cellStyle}>${row.cpc.toFixed(2)}</td>
                                                <td style={cellStyle}>{row.leads}</td>
                                                <td style={cellStyle}>{row.regs}</td>
                                                <td style={cellStyle}>{row.enrol}</td>
                                                <td style={cellStyle}>
                                                    {metrics.leadCVR > 0 && <div>L: {metrics.leadCVR.toFixed(1)}%</div>}
                                                    {metrics.regCVR > 0 && <div>R: {metrics.regCVR.toFixed(1)}%</div>}
                                                    {metrics.enrolCVR > 0 && <div>E: {metrics.enrolCVR.toFixed(1)}%</div>}
                                                </td>
                                                <td style={cellStyle}>
                                                    {metrics.cpaLead > 0 && <div>L: ${metrics.cpaLead.toFixed(2)}</div>}
                                                    {metrics.cpaReg > 0 && <div>R: ${metrics.cpaReg.toFixed(2)}</div>}
                                                    {metrics.cpaEnrol > 0 && <div>E: ${metrics.cpaEnrol.toFixed(2)}</div>}
                                                </td>
                                            </tr>
                                        );
                                    })}
                                </tbody>
                            </table>
                        </div>
                        {filteredData.length > 20 && (
                            <div style={{
                                padding: '15px',
                                textAlign: 'center',
                                background: colors.lightGray,
                                color: colors.gray
                            }}>
                                Showing first 10 of {filteredData.length.toLocaleString()} results
                            </div>
                        )}
                    </div>

                    <div style={{
                        marginTop: '20px',
                        padding: '15px',
                        background: 'white',
                        borderRadius: '8px',
                        fontSize: '13px',
                        color: colors.gray
                    }}>
                        <strong>Legend:</strong> CVR = Conversion Rate (L=Lead, R=Registration, E=Enrollment) | 
                        CPA = Cost Per Acquisition | Modifiers are mutually exclusive (each keyword counted once) | Click headers to sort
                    </div>
                </div>
            );
        };

        const root = ReactDOM.createRoot(document.getElementById('root'));
        root.render(<Dashboard />);
    </script>
</body>
</html>
